import { UserOutlined, FileOutlined,DesktopOutlined } from "@ant-design/icons";
import { useSelector } from "react-redux";
import {Breadcrumb, Layout,Menu, Tabs} from "antd";
import { Fragment, useEffect, useState } from "react";
import { NavLink, Redirect, Route } from "react-router-dom";
import { history } from "../../App";
import { TOKEN, USER_LOGIN } from "../../ulti/setting";
import _ from 'lodash';
import swal from 'sweetalert'; 

const { Header, Content , Footer, Sider} = Layout;
const {SubMenu} = Menu;



export const AdminTemplate = (props) => { //path, exact, Component

    const {Component, ...restProps} = props;
    const { userLogin } = useSelector(state => state.QuanLyNguoiDungReducer);

    const [collapsed , setCollapsed ] = useState(false);

    const onCollapse = collapsed => {
        // console.log(collapsed)
        setCollapsed(collapsed)
    };

    useEffect(() => {
        window.scrollTo(0,0);

    })

         if(!localStorage.getItem(USER_LOGIN)) {
            // alert('Bạn không có quyền truy cập vào trang này ! ')
            swal("Bạn không có quyền truy cập vào trang này!", "", "warning");
            return <Redirect to='/' />
        }

        if (userLogin.maLoaiNguoiDung !== 'QuanTri') {
            // alert('Bạn không có quyền truy cập vào trang này !')
            swal("Bạn không có quyền truy cập vào trang này!", "", "warning");
            return <Redirect to = '/' />

        } 

        const operations = <Fragment>
    {!_.isEmpty(userLogin) ? <Fragment> <button disabled onClick={()=>{
        history.push('/profile')
    }} className="text-2xl">Xin chào {userLogin.hoTen} <span><UserOutlined style={{fontSize:'30px'}}/></span></button> <button onClick={()=> {
        localStorage.removeItem(USER_LOGIN);
        localStorage.removeItem(TOKEN);
        localStorage.removeItem("accessToken");
        history.push('/home');
        window.location.reload();
    }} className='text-800'>Sign out</button> </Fragment> :''}
  </Fragment>
    //  const operations = <Fragment>
    //     {!_.isEmpty(userLogin) ?<Fragment> <button onClick={() => {
    //         history.push('profile')
    //     }}><div style={{width:50,height:50,display:'flex',justifyContent:'center'}}></div>
    //         localStorage.removeItem(USER_LOGIN);
    //         localStorage.removeItem(TOKEN);
    //         history.push('/home');
    //         window.location.reload();
    //     }} className='text-blue-800'>Đăng xuất</button></Fragment>: ''}
    // </Fragment>


    return <Route {...restProps} render={(propsRoute) => {

        return <Fragment>
            <Tabs className="m-0" style={{backgroundColor:"#001529" , color:"white"}} tabBarExtraContent={operations}>

            </Tabs>
            <Layout style={{minHeight:'100vh'}}>
                <Sider collapsible collapsed={collapsed} onCollapse = {onCollapse}>
                    <div className="logo p-5">
                        <img src=''/>
                    </div>
                    <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">

                        <SubMenu key='sub2' icon={<UserOutlined />} title="Users"> 
                            <Menu.Item key="1" icon={<UserOutlined />}>
                                <NavLink to="/admin/users">Users</NavLink>

                            </Menu.Item>
                            <Menu.Item key="2" icon={<UserOutlined />}>
                                <NavLink to="/admin/users/adduser">Add user</NavLink>

                            </Menu.Item>
                        </SubMenu>

                        <SubMenu key='sub1' icon={<FileOutlined />} title="Films"> 
                            <Menu.Item key="10" icon={<FileOutlined />}>
                                <NavLink to="/admin/films">Films</NavLink>

                            </Menu.Item>
                            <Menu.Item key="11" icon={<FileOutlined />}>
                                <NavLink to="/admin/films/addnew">Add new</NavLink>

                            </Menu.Item>
                        </SubMenu>
                        {/* <Menu.Item key="3" icon={<DesktopOutlined />}>
                            <NavLink to="/admin/showtimes">Showtime</NavLink>

                        </Menu.Item> */}



                    </Menu>
                </Sider>
                <Layout className="site-layout">
                    <Header className="site-layout-background" style={{ padding: 0 }} >
                         {/* <div className="text-right pr-10 pt-1">{operations}</div> */}
                    </Header>
                    <Content style={{ margin: '0 16px' }}>
                        <Breadcrumb style={{ margin: '16px 0' }}>


                        </Breadcrumb>
                        <div className="site-layout-background" style={{padding: 24}}>
                            <Component {...propsRoute} />
                        </div>
                    </Content>

                </Layout>
            </Layout>
        </Fragment>
     }}  />

}
